
<script>
	

function selectionSort(array){

  console.log(array);

    var currentIndex = 0;

    var init = new Date().getTime();


      while (array.length !== currentIndex) {

        
        var min = findMin(array,currentIndex);
        var temp = array[currentIndex];
        array[currentIndex] = array[min];
        array[min] = temp;


        currentIndex += 1;
        //console.log(array);

        
      }

      console.log(array);
      console.log('Sorting ' + array.length + ' elements took ' + (new Date().getTime() - init) + ' mili seconds');


}



function findMin(array, inicio) {

      var currentIndex = array.length;
      var minValue = Number.MAX_SAFE_INTEGER;
      var minIndex;
      
      
      while (inicio !== currentIndex) {

        
        currentIndex -= 1;

        if(array[currentIndex]<minValue){
        	minValue = array[currentIndex];
          minIndex = currentIndex;
        }

        
      }

      return minIndex;
}
